function FullArticleCard(props) {
   const {articles} = props;
    return (
        <div className="full_article_card">
			{articles.filter((article) => {
				return (

						<li key={article.article_id}>
							<h4>{article.title}</h4>
							<p>{article.topic}</p>
							<button>Read</button>

						</li>

				);

			})}
        </div>
		)


}

export default FullArticleCard;
